'Set up emails'=>'E-mailek indítása',
'GetStartedEmails'=>'Ajánlott beállítania e-mailjeinek funkcionalitását. Ez magába foglalja: <ul><li><strong>mail account</strong> - milyen módon lesznek az e-mailek elküldve. Kiválaszthatja akár a levél () funkciót, vagy az SMTP szervert.</li><li><strong>email templates</strong> - ezek azok a sablonok, amiket akkor használnak, ha a rendszer automatikus e-maileket küld, olyanokat, mint a jelentkezés utáni e-mail, vagy az eladásokról szóló értesítések. </li><li><strong>email notifications</strong> - konfigurálhatja, milyen fajta értesítéseket szeretne kereskedőként kapni, és milyenek legyenek hozzáférhetők a partnerek számára. </li></ul>Bizonyosodjon meg arról, hogy a levelezési azonosító megfelelően van-e beállítva - próbálja  e-mailek kiküldésével ezt leellenőrizni. Működő e-mailek nélkül a partnerek nem fognak megerősítés kapni a jelentkezésükről, stb.',
'Customize your affiliate signup form'=>'A partneri feliratkozás űrlapjának testreszabása',
'GetStartedSignupForm'=>'Ellenőrizze le a sztenderd jelentkezési űrlapot és végezzen testreszabást, ha akar. <br/><br/>
A jelentkezési űrlap egy olyan mini-site-tal érkezik, ami a partner programról szóló információt, stb. tartalmazza.<br/>Használhatja a mini-site-ot, vagy törölje ki és csak a jelentkezési űrlapot használja. ',
'Customize affiliate panel'=>'Partner panel testreszabása',
'GetStartedAffPanel'=>'A partner panel a Post Affiliate Pro-ben nagyon rugalmas.<br/>Konfigurálhatja, hogyan nézzen ki a menü, milyen tartalmat szeretne itt, és akár még hozzá is adhat tartalmat vagy más oldalakhoz tartozó linkeket is. ',
'GetStartedIntegrate'=>'Az integráció az egy olyan módszer, ami a partneri rendszert az ön saját aktuális weboldalához, vásárlói kosarához vagy fizetési hozzáféréséhez kapcsolja oly módon, hogy a partneri rendszer értesítést kap az ajánlásokról és a vásárlásokról. <br/>
Amikor értesítést kap, a partneri rendszer regisztrálja az eladást, megtalálja az ajánló partner (ha van ilyen) és létrehozza a megfelelő jutalékot a számára.<br/><br/>
Az integráció általában oldalához való néhány kódsor hozzáadását jelenti és lépésről lépésre le van írva az Integrációs útmutatóban a leggyakoribb vásárlói kosarakra és fizetési rendszerekre vonatkoztatva. ',
'Test everything'=>'Mindent tesztel',
'GetStartedTest'=>'Amikor megkonfigurálta kampányát, megadta a helyes jutalékokat és létrehozott néhány bannert/linket, a rendszer tesztelése ajánlott. <br/>
A legjobb az, ha stimulálja az egész folyamatot mind a partnerei, mind pedig a saját szempontjából:
<ol>
<li>Iratkozzon fel tesztelő partnerként - jóváhagyás után kellene kapnia egy megerősítő e-mailt a jelszavával, és be kellene tudni jelentkeznie  partner paneljére. </li>
<li>Jelentkezzen be a partner panelre, szerezze meg a kódot a bannerekhez/linkekhez és tegye fel őket néhány teszt oldalra</li> 
<li>Klikkeljen rá a bannerre és ellenőrizze, hogy a klikkek regisztrálásra kerülnek-e</li>
<li>Klikkelés után, próbálkozzon teszt eladással és ellenőrizze, hogy az eladási jutalék regisztrálásra került-e a partner-rendszerben (csak az eladásonkénti vagy regisztrációnkénti jutalékok esetében)</li>
</ol>

Ha valamilyen problémát tapasztal ezen lépések bármelyikében, kapcsolja be <strong>Debug esemény naplózás</strong>-t és nézze meg a <strong>Hibakeresés</strong>-t',
'Promote your affiliate program'=>'Partner programjának promotálása',
'GetStartedPromote'=>'Miután sikeresen letesztelte partner rendszerének integrációját weboldalával, minden készen áll új partner programjának beindítására, tehát arra, hogy új partnereket vonzzon  a csatlakozásra.<br/><br/>
